import { Typography } from "@mui/material";
import React from "react";
import CustomBox from "./CustomBox";

function IntroduceBox({ firstLine, secondLine }) {
  return (
    <CustomBox
      sx={{
        borderBottom: 1,
        borderColor: "#F2F2F2",
        textAlign: "left",
        lineHeight: "0px",
      }}
    >
      <Typography
        fontSize={{ lg: 54, xs: 30 }}
        color="#BDBDBD"
        fontWeight={100}
      >
        {firstLine}
      </Typography>
      <Typography fontSize={{ lg: 54, xs: 30 }} fontWeight="700">
        {secondLine}
      </Typography>
    </CustomBox>
  );
}

export default IntroduceBox;
